CREATE TABLE IF NOT EXISTS 'migrations' ('id' integer not null primary key autoincrement, 'migration' varchar not null, 'batch' integer not null);
CREATE TABLE IF NOT EXISTS 'password_resets' ('email' varchar not null, 'token' varchar not null, 'created_at' datetime);
CREATE TABLE IF NOT EXISTS 'failed_jobs' ('id' integer not null primary key autoincrement, 'uuid' varchar not null, 'connection' text not null, 'queue' text not null, 'payload' text not null, 'exception' text not null, 'failed_at' datetime default CURRENT_TIMESTAMP not null);
CREATE TABLE IF NOT EXISTS 'personal_access_tokens' ('id' integer not null primary key autoincrement, 'tokenable_type' varchar not null, 'tokenable_id' integer not null, 'name' varchar not null, 'token' varchar not null, 'abilities' text, 'last_used_at' datetime, 'created_at' datetime, 'updated_at' datetime);
CREATE TABLE IF NOT EXISTS 'categories' ('id' integer not null primary key autoincrement, 'title' varchar, 'created_at' datetime, 'updated_at' datetime, 'deleted_at' datetime);
CREATE TABLE IF NOT EXISTS 'posts' ('id' integer not null primary key autoincrement, 'title' varchar not null, 'content' text not null, 'category_id' integer, 'created_at' datetime, 'updated_at' datetime, 'preview_image' varchar, 'main_image' varchar, 'deleted_at' datetime, foreign key('category_id') references 'categories'('id'));
CREATE TABLE IF NOT EXISTS 'post_tags' ('id' integer not null primary key autoincrement, 'post_id' integer not null, 'tag_id' integer not null, 'created_at' datetime, 'updated_at' datetime, foreign key('post_id') references 'posts'('id'), foreign key('tag_id') references 'tags'('id'));
CREATE TABLE IF NOT EXISTS 'tags' ('id' integer not null primary key autoincrement, 'title' varchar not null, 'created_at' datetime, 'updated_at' datetime, 'deleted_at' datetime);
CREATE TABLE users (id INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, name VARCHAR(255) NOT NULL COLLATE BINARY, email VARCHAR(255) NOT NULL COLLATE BINARY, email_verified_at DATETIME DEFAULT NULL, password VARCHAR(255) NOT NULL COLLATE BINARY, remember_token VARCHAR(255) DEFAULT NULL COLLATE BINARY, created_at DATETIME DEFAULT NULL, updated_at DATETIME DEFAULT NULL, deleted_at DATETIME DEFAULT NULL, 'role' integer);
CREATE TABLE IF NOT EXISTS 'jobs' ('id' integer not null primary key autoincrement, 'queue' varchar not null, 'payload' text not null, 'attempts' integer not null, 'reserved_at' integer, 'available_at' integer not null, 'created_at' integer not null);
CREATE TABLE IF NOT EXISTS 'post_user_likes' ('id' integer not null primary key autoincrement, 'post_id' integer not null, 'user_id' integer not null, 'created_at' datetime, 'updated_at' datetime, foreign key('post_id') references 'posts'('id'), foreign key('user_id') references 'users'('id'));
CREATE TABLE IF NOT EXISTS 'comments' ('id' integer not null primary key autoincrement, 'user_id' integer not null, 'post_id' integer not null, 'message' text not null, 'created_at' datetime, 'updated_at' datetime, foreign key('user_id') references 'users'('id'), foreign key('post_id') references 'posts'('id'));
CREATE INDEX 'password_resets_email_index' on 'password_resets' ('email');
CREATE UNIQUE INDEX 'failed_jobs_uuid_unique' on 'failed_jobs' ('uuid');
CREATE INDEX 'personal_access_tokens_tokenable_type_tokenable_id_index' on 'personal_access_tokens' ('tokenable_type', 'tokenable_id');
CREATE UNIQUE INDEX 'personal_access_tokens_token_unique' on 'personal_access_tokens' ('token');
CREATE INDEX 'post_category_idx' on 'posts' ('category_id');
CREATE INDEX 'post_tag_post_idx' on 'post_tags' ('post_id');
CREATE INDEX 'post_tag_tag_idx' on 'post_tags' ('tag_id');
CREATE UNIQUE INDEX users_email_unique ON users (email);
CREATE INDEX 'jobs_queue_index' on 'jobs' ('queue');
CREATE INDEX 'pul_post_idx' on 'post_user_likes' ('post_id');
CREATE INDEX 'pul_user_idx' on 'post_user_likes' ('user_id');
CREATE INDEX 'comments_post_idx' on 'comments' ('post_id');
CREATE INDEX 'comments_user_idx' on 'comments' ('user_id');
COMMIT;
