INSERT INTO posts VALUES(7,'История сэмплов: «Нипсы»','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Не хочется покупать аромат, хорошенько не распробовав композицию? Нет возможности купить целый флакон? А может быть, просто забыли подушиться перед выходом из дома? В прошлый раз мы рассказывали о парфюмерных вендинговых автоматах, позволявших всем желающим получить разовую порцию распыленного парфюма за весьма условную плату. Сегодня поговорим об автоматах, продающих парфюмерные сэмплы и об истории возникновения самих сэмплов. История сэмплов началась в двадцатые годы прошлого века, когда были популярны вендинговые парфюмерные автоматы, среди которых встречались и такие, которые продавали специальные одноразовые ампулы с ароматами. В тридцатых годах подобные автоматы выпускались, например, чикагской компанией A.B.T. Corp. В автомате этой марки было четыре отделения, в каждом из которых лежали наборы одноразовых сэмплов, стоимостью в двадцать пять центов. Эти сэмплы, производимые компанией Nips Company Inc, назывались «нипсами». На английском языке одно из значений слова «nip» – это «небольшой глоток», «маленький кусочек». В таких сэмплах как раз и был «глоточек», порция, рассчитанная на одно применение. Выглядели они совсем не так, как привычные нам сегодня сэмплы в виде маленьких спреевых цилиндров. «Нипсы» - это стеклянные или пластиковые трубочки-ампулки, концы которых нужно было надламывать точно также, как надламываются обычные медицинские ампулы. Длина каждого «нипса» составляла около шести сантиметров, внутри содержалось несколько капель духов, достаточных для одного применения. Точный объем неизвестен – так как маркировка «нипсов» не подразумевала обозначение количества миллилитров. Современные коллекционеры измеряли фармацевтической пипеткой содержимое одной ампулы, получалось что-то около двух-трех капель или одна двенадцатая часть от одного мл духов. Эти запатентованные одноразовые пробирочки с ароматами продавались с двадцатых по семидесятые годы, при этом расцвет их популярности пришелся на тридцатые-пятидесятые. Кроме Nips Company, Inc подобными сэмплами торговала еще одна американская компания - Nippola Products Co. Ходили слухи, что сэмплы в работе этой компании были не самоцелью, а прикрытием для бутлегеров алкоголя. Nippola Products Co. продавала в сэмплах как переупакованные ароматы известных и модных на тот момент парфюмерных домов, так и ароматы собственного производства – Pagan Princess, Swee-Tone и Ramona.</span><br></p>',6,'2022-10-07 16:41:12','2022-10-07 16:41:12','images/nfDNNTbc1axnQCuTgxPQlWDSdeVkk5bhcL7r7COq.webp','images/JRQVKoK5ShT7dqOCCmX3DIdvwGCG24r5PHzny3bq.jpg',NULL);
INSERT INTO posts VALUES(8,'Бриллианты','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Парфюмерная индустрия так же разнообразна, как и количество известных миру ароматических веществ. Существует масс-маркет с бюджетными вариантами и огромным выбором. Если вы готовы экспериментировать (и тратить деньги), то можно обратиться к нишевой парфюмерии. Есть также независимые артизанальные бренды с самыми необычными запахами. Но отдельно от всех стоят парфюмерные дома, которые выпускают духи, чья стоимость порой бывает сопоставима с топовой недвижимостью в мегаполисе, и они тоже находят своих ценителей. В этой статье мы собрали самые дорогие ароматы в мире — рассказываем подробнее о каждом из них.&nbsp;</span><br></p>',6,'2022-10-07 16:42:59','2022-10-07 17:39:57','images/VwD3EEuC4RuevN3KLqbiHRc32ScgX0Webxz8WhAJ.webp','images/b2CjvGQCJ3HzWjFGlYiXnEv1gNbUPVFrBjtAAhG3.jpg',NULL);
INSERT INTO posts VALUES(9,'Морской артефакт и янтарь в солнечных лучах: всё об амбровых ароматах','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>В парфюмерии часто возникает путаница между амброй (amber) и серой амброй (ambergris). Одна из них является фантазийным парфюмерным аккордом, другая — продуктом жизнедеятельности кашалотов. Почему амбру часто называют янтарём и как отличаются одни амбровые ароматы от других, читайте в нашем материале. Серая амбра Серая амбра получила свое название благодаря серому цвету вязкого, пастообразного вещества, образующегося в пищеварительном тракте кашалотов в качестве защитной реакции на множественные мелкие раны, полученные в процессе питания. После выполнения секретом своей функции, он исторгается за пределы организма животного и становится серой амброй, плавая на поверхности воды и подвергаясь воздействию солнца.&nbsp;</span><br></p>',7,'2022-10-07 17:31:13','2022-10-07 17:31:13','images/3JuCe16KRVHzKtP4Zr2fOjemebzK4xetPTflztyN.webp','images/5vsfDzh2jEAXRFJsy7xS0RAuM1BxqmOBMpCgznxK.webp',NULL);
INSERT INTO posts VALUES(10,'Розы, Париж и сюрреализм: 5 легендарных флаконов Baccarat','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>В этом году Baccarat, производитель знаменитого хрусталя, отметит 258-летие. Новые владельцы компании переориентировались на миллениалов, расширяют уже существующие коллекции и создают «вселенную Baccarat». Фабрика известна не только люстрами, винными бокалами и предметами декора, но и уникальными флаконами для ароматов, созданных люксовыми брендами — мы вспомнили пять наиболее известных примеров. История фабрики Baccarat: от бокала Harcourt до люстры от Филиппа Старка Стеклодувная фабрика была создана в 1764 году по указу короля Людовика XV в деревне Баккара, находившейся в 400 км к востоку от Парижа. Первым владельцем был местный епископ, Меца Монморанси-Лаваль, сама мануфактура называлась «Святая Анна», и делали здесь исключительно стекло. Производство хрусталя началось лишь в 1816 году, когда фабрику купил негоциант Эме-Габриэль Д’Артиг, у которого уже была хрустальная мануфактура в Бельгии. Ещё спустя 16 лет заводы Baccarat, Saint-Louis и Choisy-Le-Roy основали торговое сообщество Launay, Hautin &amp; Cie и начинали издавать иллюстрированный каталог продукции.</span><br></p>',7,'2022-10-07 18:20:44','2022-10-07 18:20:44','images/LI5AYlvtQQ9vTPrVpfHHPxIHcse9rPXCWxsk2bYx.webp','images/Hn6emq7tQ2n3OwUdcMZR92PvpGg98Ru5ECVXtakH.webp',NULL);
INSERT INTO posts VALUES(11,'Как флаконы-атомайзеры стали популярными','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Девяносто процентов всей современной парфюмерной продукции разливается во флаконы-атомайзеры (флаконы с распылителями). При этом флаконы с притёртыми стопперами, напротив, ассоциируются с традициями начала ХХ века: вот изысканная дама в своем будуаре аккуратно наносит каплю духов за ухо, а вот одетый по последней моде денди выливает на себя целую склянку одеколона. Но мало кто знает, что атомайзеры, практически полностью вытеснившие сегодня сплэшевые флаконы, появились уже более века назад. Один из первых парфюмерных атомайзеров был представлен на Всемирной парижской выставке в далеком 1878 году, где произвел оглушительный успех. Благодаря этому уже к концу XIX века на парфюмерном рынке появилось множество атомайзеров различных конфигураций, однако самыми популярными в те годы были атомайзеры в виде пульверизаторов с длинной трубкой, ведущей от флакона к груше, которые лишь со временем уступили место привычным спреям. Некоторые экземпляры имели по два, три и даже четыре отделения для различных ароматов, каждый со своим отдельным распылителем. Первое время такие пульверизаторы изготовлялись частными мастерами, но вскоре началось и промышленное производство.&nbsp;</span><br></p>',6,'2022-10-07 18:22:01','2022-10-07 18:22:01','images/J27i9MVLdG1hiNEyfPRMznvKTM272a62J8W23x3v.webp','images/qfO7Ss6PrGwOpaJpM3LCqzNIwW0lkiMMcXvaqiI9.webp',NULL);
INSERT INTO posts VALUES(12,'Будем как Солнце: 7 концептуальных российских брендов, выпускающих ароматические свечи','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Новый концептуальный бренд свечей «Как солнце» объявил о запуске в России. Марка представляет предметы искусства и одновременно дизайна интерьера, над которыми работают талантливые современные деятели искусства. Первая коллекция разработана в коллаборации с художницей Марго Трушиной. Она создала лимитированную серию свечей, в основу которой легла идея о планетарном сознании как о глубокой взаимосвязи природы и человека. Она старалась передать ощущения единства человека и космоса путем активации пяти органов чувств: осязания, зрения, вкуса, слуха и обоняния. Художница посвятила свечи небесным телам — Солнцу, Земле и Луне. Вместе с Марго в разработке коллекции принимали участие парфюмеры Алиенор Массене, Марчелла Оляльде де Кастильо, Джери Падоли и Фабьен Купэй. Свеча «Солнце» передает пудровый аромат, в котором цветочные ноты мимозы и фрезии сочетаются с луговыми травами и древесными аккордами кедра, сандала и мускуса. Аромат «Луны» сочетает флористические компоненты сирени, пиона, фиалки и жасмина с запахом розового перца и древесными акцентами. Свеча «Земля» объединяет свежую зеленую композицию с нотами эвкалипта, папоротника, шалфея, пихты и раскрывает теплые аккорды бергамота, мускатного ореха и целого поля васильков.&nbsp;</span><br></p>',5,'2022-10-07 18:23:22','2022-10-07 18:23:22','images/g1J1X2Ocv6NO5oBO9arCJ7PGorsr31gJFadXxqOx.webp','images/QDtxXbvfbzBtwoTFeoSEIyGx633qY3jlYzGwwMgp.webp',NULL);
INSERT INTO posts VALUES(13,'империя мануфактуры Baccarat','<p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Баккара - старинная карточная игра или поп-группа из 80-х? Оба предположения верны.</span><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Однако для любителей парфюмерии это слово в первую очередь ассоциируется со знаменитой фабрикой, производящей удивительные фигурные флаконы из хрусталя.</span></p><p><img style='float: left; width: 50%;' src='data:image/jpeg;base64,' data-filename='141_21_1.jpg' class='note-float-left'><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'><br></span></p><p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>«Хороший флакон – не только вместилище аромата, но и произведение пластического искусства, он воплощение мечты и ее декорация, никак не связанная с обыденностью, это престижная ценность, источник гордости и наслаждения» - эта цитата из книги Й.</span></p><p><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'>Стефана Еллинека «Духи – мечта во флаконе» в полной мере относится к флаконам от Baccarat.&nbsp;</span><span style='color: rgb(20, 20, 20); font-family: Geometria, sans-serif; font-size: 15px;'><br></span><br></p>',6,'2022-10-11 10:50:02','2022-10-11 10:53:06','images/nOQilObR8Mlb1vMBejo3eyBsVZN8j6Lo5jC57bMY.webp','images/2qYfmikuw1udB60LSiMO14XlAPEyM421NHK8qu8g.webp',NULL);
